import React from 'react';
import { Link } from 'react-router-dom';
import SignUp from '../SignUp/SignUp';
import './header.css'

function Header(props) {
    return (
        <header>
            <div class='headerContainer'>
                <h2>toMasterDev</h2>
                <div class='headerButtonsContainer'>
                    <button className='headerButton' id='browseButton' hidden>Browse</button>
                    <button className='headerButton' id='signInButton'>Sign In</button>
                    <Link to='signup' component={SignUp}><button className='headerButton' id='signUpButton'>Sign Up</button></Link>
                </div>
            </div>

        </header>
    );
}

export default Header;
